SET @s_id = (SELECT MAX(id) FROM eh_punch_schedulings);

SELECT DISTINCT CONCAT("
" values('",@s_id :=@s_id +1,"','",r.`owner_type`,"','",r.`owner_id`,"','USER_DETAIL','",d.`detail_id`,"','",s.`rule_date`,"','",r.`id`,"','",s.`time_rule_id`,"');")
